class _OriginalPuzzlesState extends State<OriginalPuzzles>
    with AutomaticKeepAliveClientMixin<OriginalPuzzles> {
  bool _showCompleted = false;
  SplayTreeSet<int> _cleared = SplayTreeSet();
  SplayTreeSet<int> _starred = SplayTreeSet();

  @override
  void initState() {
    super.initState();

    PuzzleProgressionManager.getCleared().then((SplayTreeSet<int> cleared) {
      setState(() {
        _cleared = cleared;
      });
    });

    PuzzleProgressionManager.getStarred().then((SplayTreeSet<int> starred) {
      setState(() {
        _starred = starred;
      });
    });
  }

  void _handlePuzzleWin(int i, bool starred) {
    setState(() {
      if (!_cleared.contains(i)) {
        _cleared.add(i);
        PuzzleProgressionManager.setCleared(i);
      }

      if (starred && !_starred.contains(i)) {
        _starred.add(i);
        PuzzleProgressionManager.setStarred(i, starred);
      }
    });
  }

  void _openPuzzle(int puzzleIndex) {
    if (puzzleIndex < OriginalPuzzles.puzzles.length) {
      Navigator.of(context)
          .push(MaterialPageRoute<OverlayResult>(
              builder: (context) => Puzzle(
                    puzzle: OriginalPuzzles.puzzles[puzzleIndex],
                    onWin: (bool starred) =>
                        _handlePuzzleWin(puzzleIndex, starred),
                    hasNext: (puzzleIndex + 1) < OriginalPuzzles.puzzles.length,
                  )))
          .then((OverlayResult? overlayResult) {
        if (overlayResult != null) {
          if (overlayResult == OverlayResult.PlayNext) {
            _openPuzzle(puzzleIndex + 1);
          } else if (overlayResult == OverlayResult.PlayAgain) {
            _openPuzzle(puzzleIndex);
          }
        } else {
          Router.of(context)
              .routeInformationProvider!
              .routerReportsNewRouteInformation(
                  RouteInformation(location: '/${PageKind.Puzzle.slug}'));
        }
      });
      Router.of(context)
          .routeInformationProvider!
          .routerReportsNewRouteInformation(RouteInformation(
              location:
                  '/${PageKind.Puzzle.slug}/${TabKind.Original.slug}/${Slugify(OriginalPuzzles.puzzles[puzzleIndex].name)}'));
    }
  }

  String _difficultyFromIndex(BuildContext context, int index) {
    if (index >= 0 && index < 25) {
      return NyaNyaLocalizations.of(context).easyLabel;
    } else if (index >= 25 && index < 50) {
      return NyaNyaLocalizations.of(context).intermediateLabel;
    } else if (index >= 50 && index < 75) {
      return NyaNyaLocalizations.of(context).hardLabel;
    } else if (index >= 75 && index < 100) {
      return NyaNyaLocalizations.of(context).veryHardLabel;
    } else {
      return 'Unspecified';
    }
  }

  Widget _buildPuzzleTile(int i) {
    return ListTile(
      key: ValueKey(i),
      leading: Padding(
        padding: const EdgeInsets.symmetric(vertical: 16),
        child: Text(
          '${i + 1}',
          style: TextStyle(fontSize: 15),
          textAlign: TextAlign.center,
        ),
      ),
      title: Text(OriginalPuzzles.puzzles[i].name),
      subtitle: Text(_difficultyFromIndex(context, i)),
      trailing: Row(mainAxisSize: MainAxisSize.min, children: <Widget>[
        Visibility(
          visible: _starred.contains(i),
          child: Icon(
            Icons.star,
            color: Theme.of(context).accentColor,
          ),
        ),
        Visibility(
          visible: _cleared.contains(i),
          child: Icon(
            Icons.check,
            color: Colors.green,
          ),
        ),
      ]),
      onTap: () {
        _openPuzzle(i);
      },
    );
  }

  @override
  bool get wantKeepAlive => true;

  @override
  Widget build(BuildContext context) {
    super.build(context);

    List<int> puzzleIndices =
        Iterable<int>.generate(OriginalPuzzles.puzzles.length).toList();

    if (!_showCompleted) {
      puzzleIndices = SplayTreeSet<int>.from(puzzleIndices)
          .difference(_cleared)
          .toList(growable: false);
    }

    return Column(
      children: [
        Expanded(
          child: OrientationBuilder(
            builder: (BuildContext context, Orientation orientation) {
              if (orientation == Orientation.landscape ||
                  MediaQuery.of(context).size.width >= 270 * 2.5)
                return _buildLandscape(context, puzzleIndices);
              else
                return _buildPortrait(puzzleIndices);
            },
          ),
        ),
        CompletionIndicator(
          showCompleted: _showCompleted,
          completedRatio: _cleared.length / OriginalPuzzles.puzzles.length,
          onChanged: (bool? value) {
            if (value != null) {
              setState(() {
                _showCompleted = value;
              });
            }
          },
        )
      ],
    );
  }

  Widget _buildPortrait(List<int> puzzleIndices) {
    return ListView.builder(
        itemCount: puzzleIndices.length,
        itemBuilder: (context, i) => _buildPuzzleTile(puzzleIndices[i]));
  }

  Widget _buildLandscape(BuildContext context, List<int> puzzleIndices) {
    return GridView.builder(
        gridDelegate: SliverGridDelegateWithMaxCrossAxisExtent(
          maxCrossAxisExtent: 270,
        ),
        itemCount: puzzleIndices.length,
        itemBuilder: (context, i) => _buildPuzzleCard(puzzleIndices[i]));
  }

  Widget _buildPuzzleCard(int i) {
    return InkWell(
      key: ValueKey(i),
      child: Card(
        child: Column(
          mainAxisAlignment: MainAxisAlignment.spaceEvenly,
          children: [
            Padding(
                padding: const EdgeInsets.symmetric(horizontal: 8.0),
                child: AspectRatio(
                  aspectRatio: 12 / 9,
                  child: Stack(
                    children: [
                      StaticGameView(
                        game: OriginalPuzzles.puzzles[i].puzzleData.getGame(),
                      ),
                      Visibility(
                        visible: _cleared.contains(i),
                        child: Container(
                          color: Colors.black.withOpacity(0.5),
                          child: Center(
                            child: Icon(
                              Icons.check,
                              color: Colors.green,
                              size: 150,
                            ),
                          ),
                        ),
                      )
                    ],
                  ),
                )),
            Text(
              OriginalPuzzles.puzzles[i].name,
              style: TextStyle(fontWeight: FontWeight.bold),
            ),
            Text(_difficultyFromIndex(context, i))
          ],
        ),
      ),
      onTap: () {
        _openPuzzle(i);
      },
    );
  }
}
